const SectionTwo = () => {
    return ( 
        <section className=" bg-bg-boost-mobile h-48 bg-center bg-darkViolet bg-no-repeat">
            <div className="w-10/12 mx-auto text-center grid place-items-center">
                <h2 className=" text-2xl font-bold py-4">Boost your links today</h2>
                <button className="bg-cYan w-40 py-3 text-white rounded-3xl">Get Started</button>
            </div>
        </section>
    );
}

export default SectionTwo;
